import React, { Component } from 'react';
import logo from "../../assets/mdb-react.png";
import { MDBListGroup, MDBListGroupItem, MDBIcon } from 'mdbreact';
import { NavLink } from 'react-router-dom';
import "./sideNav.css";
import "./dash.css";
import {Getdata} from './Getdata' 


const url = 'https://api.flippay.co/user/user';
class TopNavigation extends Component{
    constructor(props) {
        super(props);
        this.state = {
          error: undefined,
          isLoaded: false,
          items: [],
        };

       this.getData = this.getData.bind(this);
       this.getTokenFromStorage = this.getTokenFromStorage.bind(this);
      }
      componentDidMount() {
        this.getData();
        this.getTokenFromStorage();
      }

      getData(){
          const JSON_HEADERS = {
            'Accept': 'application/json',
            'Content-Type': 'application/json; charset=utf-8'
          }
        const getTokenFromStorage = () => localStorage.getItem('userData');

        const getHeaders = () => getTokenFromStorage().then((userData) => {
          if (!userData) {
            return JSON_HEADERS;
          }
          return {
            ... JSON_HEADERS,
            'x-access-token': userData
          };
        });
        // let auth =  'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOiI1ZjRlODI0YjAyY2VlMmVlOGE0NzMyODgiLCJlbWFpbCI6InRlc3RAdGVzdC5jb20iLCJ1c2VybmFtZSI6InRlc3QxMjMiLCJ2ZXJpZmllZCI6ZmFsc2UsImJhbGFuY2UiOjAsInBlbmRpbmciOjAsImlhdCI6MTYwMDQyNDk2NSwiZXhwIjoxNjAwNDM5MzY1fQ.1sTi_umhA61I7l8GzYUUa4ObH4MI4YfQdwSPl0CCq78';
              return fetch(url, {
               method: 'GET',
               headers: getHeaders()
            //    {
                //    getHeaders()
                //  Accept: 'application/json',
                //           'Content-Type': 'application/json',
                //           'Authorization': "Bearer " + auth,
                //   },
             })
                 .then(res => res.json())
                 .then(
                    (result) => {

                      this.setState({
                        isLoaded: true,
                        items: result,
                      })
                    //   console.log({items})
                    },
                    (error) => {
                      this.setState({
                        isLoaded: true,
                        error
                      });
                    }
                  )
            }
    render(){
        const { error, isLoaded, items } = this.state;
        if (error) {
          return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
          return <div></div>;
        } else {
        return (
            <div className="sidebar-fixed position-fixed" id="background-logo" color="primary-color-dark">
                <div>
                    <a href="#!" className="logo-wrapper waves-effect">
                        <img alt="MDB React Logo" className="img-fluid" src='/images/IMG-20200317-WA0134-removebg.png'/>
                    </a>
                </div>

                <div className="user-circle">
                    <img
                    src="https://mdbootstrap.com/img/Photos/Avatars/img%20(9).jpg"
                    alt=""
                    className="rounded-circle img-fluid userImg"
                    />
                    <p style={{color: "white"}}>Test User</p>
                    <p style={{color: "white", marginTop: "-10px"}}>{items.user.email}</p>
                    <div></div>
                    <div>
                    </div>
                </div>

                <div className="sideStyle">
                    <MDBListGroup className="list-group-flush">
                        <NavLink exact={true} to="/" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="chart-pie" className="mr-3"/>
                                Dashboard
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/Wallet" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="user" className="mr-3"/>
                                Wallet
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/tables" activeClassName="activeClass listen">
                            <MDBListGroupItem>
                                <MDBIcon icon="table" className="mr-3"/>
                                Lorem
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/maps" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="map" className="mr-3"/>
                                Lorem
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/404" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="exclamation" className="mr-3"/>
                                404
                            </MDBListGroupItem>
                        </NavLink>
                    </MDBListGroup>
                </div>
            </div>
        );
        }
    }
}

export default TopNavigation;
